import React from 'react';
import styled from 'styled-components';
import Slider from 'react-slick';

const TestDiv = styled.div`
  width: 100%;
  background: gray;
`;

const MainSlideShow = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };
  return (
    <div>
      <h2>slideShow</h2>
      <Slider {...settings}>
        <TestDiv />
        <TestDiv />
        <TestDiv />
        <TestDiv />
      </Slider>
    </div>
  );
};

export default MainSlideShow;
